import React from 'react';
// import sections
import MessageSection from '../components/sections/MessageSection';
import GeneratedSection from '../components/sections/GenerationSection';
import VocabSection from '../components/sections/VocabSection';

const Home = () => {
  return (
    <>
      <GeneratedSection />
      <VocabSection />
    </>
  );
}

export default Home;
